import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const CarnivoreMenuPage = ({ setCurrentPage, setSelectedFood, setSelectedRestaurant }) => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');

  // Carnivore Restaurant Info
  const carnivoreRestaurant = {
    id: 'carnivore-001',
    name: 'Carnivore Restaurant',
    location: 'Langata Road, Nairobi',
    rating: 4.8,
    priceRange: '$$$',
    cuisine: 'African BBQ, Game Meat',
    image: '/images/restaurants/Tamarind-Restaurant.jpg', // We'll update this with Carnivore image
